import React from "react";
import "../../css/EventDetails.css";

const EventDetails = ({
  eventName,
  user: { firstName, lastName },
  eventDate,
  location,
  description,
}) => {
  const userName = `${firstName} ${lastName}`;
  const date = `${new Date(eventDate).toLocaleDateString("en-US", {
    weekday: "long",
    year: "numeric",
    month: "long",
    day: "numeric",
  })}\n${new Date(eventDate).toLocaleTimeString("en-US", {
    hour: "numeric",
    minute: "numeric",
    hour12: true,
  })}`;
  return (
    <section className="event-detail">
      <p className="event-prompt-header-1">
        Current Viewing: <span className="event-name-bold">{eventName}</span> by
        Event <span className="event-name-bold">{userName}</span>
      </p>
      <p className="event-prompt-header-2">
        Are You Sure You Want To Attend This Event?
      </p>
      {/* Create back button navigate back to the event board */}
      <div className="btn-container">
        <button className="btn discard-event-btn">Discard</button>
        <button className="btn join-event-btn">Join</button>
      </div>
      <div className="event-card-container">
        {/* EVENT CARD*/}
        <article className="event-card-content">
          <p className="match-tag">Match</p>
          <div className="card-content">
            <h2 className="card-title">{eventName}</h2>
            <p>Host: {userName}</p>
            <p>Meeting Time: {date}</p>
            <p>Location: {location}</p>
            {/* <p>Duration: {"event.duration"} hours</p> */}
            <p className="event-details">
              <span className="event-details-header">Event Details:</span>{" "}
              <br /> <span className="event-details-text">{description}</span>
            </p>
            <p className="event-tag">Interested In Learning This Skill?</p>
            <div className="contact-block">
              <button className="contact-btn">Message</button>
              <div className="contact-details">
                <p>User: {userName}</p>
                <p>Memeber Since: {2023}</p>
              </div>
            </div>
          </div>
        </article>
        {/* EVENT CARD*/}
        <div className="event-outline">
          <div className="card-content">
            <p className="card-text-section">Event Outline</p>
            <h2 className="card-title">{eventName}</h2>
            <p>Host: {userName}</p>
            <p>Meeting Time: {date}</p>
            <p>Location: {location}</p>
            {/* <p>Duration: {"event.duration"} hours</p> */}
            <p className="event-details">
              <span className="event-details-header">Description:</span> <br />{" "}
              <span className="event-details-text">{description}</span>
            </p>
          </div>
        </div>
      </div>
    </section>
  );
};

export default EventDetails;
